import React from "react";
import Navbar from "./Navbar";
import axios from 'axios';

function DispProp() {
    
  const [propList, setpropList] = useState([]);

  //Similar to componentDidMount and componentDidUpdate
  useEffect(() => {
    axios.get('http://localhost:4500/emp')
      .then(response => {
        console.log(response.data)
        setpropList(response.data);
      })
      .catch((error) => {
        console.log(error);
      })
  }, [])

  function viewpropList() {
    return propList.map((currentrow, index) => {
      return (
        <tr key={index}>
          <td>{currentrow.title}</td>
          <td>{currentrow.empmobile}</td>
          <td>{currentrow.empdob}</td>
          <td>{currentrow.empgender}</td>
          <td>{currentrow.empcountry}</td>
          <td>{currentrow.empaddress}</td>
        </tr>
      );
    });
  }

  return (
    <div className="contact">
      <Navbar />
      <h1 class="head">Properties</h1>
      <div class="card text-center card-width ">
        <div class="card-header ">
          <h5 class="card-title">Special title treatment</h5>
        </div>
        <div class="card-body">
          <p class="card-text">
          {/* {viewpropList()} */}
          {title}
            With supporting text below as a natural lead-in to additional
            content.
          </p>
        </div>
        <div class="card-footer text-muted">
          <a href="#" class="btn btn-primary">
            Buy
          </a>
        </div>
      </div>
    </div>
  );
}
export default DispProp;
